    def parse(self, response):
        item = DadosItem()
        respostas = response.xpath('//div[@id="answers"]//div[@class="s-prose js-post-body"]/p/text()').extract()
        respostas = [sh.cleanup(x) for x in respostas]
        item['answer'] = ' '.join(respostas)

        questoes = response.xpath("//*[contains(@id,'question')]//p/text()").extract()
        questoes = [sh.cleanup(x) for x in questoes]
        item['question'] = ' '.join(questoes)

        comentarios = response.xpath('//div[@class="comments js-comments-container bt bc-black-075 mt12 "]//ul//span[@class="comment-copy"]/text()').extract()
        comentarios = [sh.cleanup(x) for x in comentarios]
        item['comments'] = ' '.join(comentarios)

        item['amount_comments'] = len(response.css('.comment-copy').extract())

        votos = response.xpath("//*[contains(@id,'question')]//div[@itemprop='upvoteCount']/text()").extract()
        votos = [sh.cleanup(x) for x in votos]
        item['votes'] = ''.join(votos)

        yield item
        